import React, { Component } from 'react';
import Radium from 'radium';
import axios from '../axios-orders';

class PageOne extends Component {
    render() {

        const style = {
            backgroundColor: 'lightyellow',
            border: '2px solid black',
            ':hover': {
                backgroundColor: 'lightgreen',
                color: 'black'
            }
        }

    externalSubmit = (event) => {
        console.log(event.value)
    };

        return (

            <div className="container" style={style}>

            <form name="pageOne" onSubmit={() => this.externalSubmit(event)}>
            <p>PAGE 1</p>
            <h1>Start from your environmental researches</h1>
            <h2>External analysis</h2>
            <p>use PESTEL in order to cover the basic points</p>
            Political
            <input type="text" />
            <br/>
            Economical
            <input type="text" />
            <br/>
            Social
            <input type="text" />
            <br/>
            Technological
            <input type="text" />
            <br/>
            Environmental
            <input type="text" />
            <br/>
            Legal
            <input type="text" />
            <br/>
            <input type="submit" value="Submit" />

            </form>
            </div>
            );
    }
};

export default Radium(PageOne)
